import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "../../utils/axios";

const ModelDetail = () => {
  const { slug } = useParams();
  const [model, setModel] = useState(null);

  useEffect(() => {
    axios.get(`/models/${slug}`).then((res) => {
      setModel(res.data.model);
    });
  }, [slug]);

  if (!model) return null;

  return (
    <main className="single-profile">
      {/* TITLE BAR */}
      <section className="sp-title-bar">
        <div className="sp-inner">
          <h1 className="sp-main-title">{model.tagline}</h1>
          <p className="sp-subline">
            {model.age} yrs • {model.nationality} •{" "}
            {model.serviceAreas?.join(", ")}
          </p>
        </div>
      </section>

      {/* PROFILE */}
      <section className="sp-details">
        <div className="sp-inner">
          <div className="sp-details-grid">
            {/* LEFT */}
            <div className="sp-main-column">
              <article className="sp-card">
                <header className="sp-profile-header">
                  <div>
                    <h1 className="sp-profile-name">{model.name}</h1>
                    <p className="sp-profile-sub">
                      Independent escort in <strong>{model.location}</strong>
                    </p>
                  </div>

                  <div className="sp-profile-header-meta">
                    <span className="sp-profile-pill">Age {model.age}</span>
                    <span className="sp-profile-pill">{model.nationality}</span>
                    <span className="sp-profile-pill">{model.serviceType}</span>
                  </div>
                </header>

                {/* IMAGES */}
                <div className="sp-profile-top">
                  <div className="sp-photo-row">
                    {model.portfolio?.slice(0, 2).map((img) => (
                      <div key={img._id} className="sp-photo-box">
                        <img src={img.url} className="sp-photo-img" />
                      </div>
                    ))}
                  </div>
                </div>

                {/* ABOUT */}
                <section className="sp-profile-bio">
                  <h2 className="sp-profile-section-title">About me</h2>
                  <div
                    className="sp-profile-bio-text"
                    dangerouslySetInnerHTML={{ __html: model.about }}
                  />
                </section>
              </article>
            </div>

            {/* RIGHT */}
            <aside className="sp-side-column">
              <div className="sp-card sp-main-info-card">
                <div className="sp-info-grid">
                  <Info label="Age" value={model.age} />
                  <Info label="Height" value={model.height || "-"} />
                  <Info label="Cup size" value={model.breastSize} />
                  <Info label="Price / hr" value={`$${model.price1Hour}`} />
                </div>

                <div className="sp-contact-section">
                  <ContactRow label="Phone" value={model.phone} />
                  <ContactRow label="Website" value={model.website} link />
                </div>
              </div>
            </aside>
          </div>
        </div>
      </section>

      {/* GALLERY */}
      <section className="sp-agency-strip">
        <div className="sp-gallery-grid">
          {model.portfolio?.map((img) => (
            <div key={img._id} className="sp-gallery-item">
              <img src={img.url} className="sp-gallery-img" />
            </div>
          ))}
        </div>
      </section>
    </main>
  );
};

const Info = ({ label, value }) => (
  <div className="sp-info-item">
    <div className="sp-info-label">{label}</div>
    <div className="sp-info-value">{value}</div>
  </div>
);

const ContactRow = ({ label, value, link }) => (
  <div className="sp-contact-row">
    <div className="sp-contact-label">{label}:</div>
    <div className="sp-contact-main">
      {link ? <a href={value}>{value}</a> : value}
    </div>
  </div>
);

export default ModelDetail;
